import AdminNavbar from "./AdminComponents/AdminNavbar";
import AdminHome from "./AdminComponents/AdminHome";
import AdminAbout from "./AdminComponents/AdminAbout";
import AdminLogin from "./AdminComponents/AdminLogin";
import AdminGallery from "./AdminComponents/AdminGallery";
import AdminContact from "./AdminComponents/AdminContact";
import AdminPainting from "./AdminComponents/AdminPainting";
import AdminSculpture from "./AdminComponents/AdminSculpture";
import AdminAll from "./AdminComponents/AdminAll";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <AdminNavbar></AdminNavbar>
      <Routes>
        <Route exact path="/" element={<AdminLogin />} />
        <Route exact path="/about" element={<AdminAbout />} />
        <Route exact path="/Gallery" element={<AdminAll />} />
        <Route exact path="/contact" element={<AdminContact />} />
        <Route exact path="/Painting" element={<AdminPainting />} />
        <Route exact path="/Sculpture" element={<AdminSculpture />} />
        <Route exact path="/All" element={<AdminAll />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
